let Q = require('../index').q

if (process.argv[2]) {
    console.log('DELETE Q - ', process.argv[2])
    let mq = new Q({}, process.argv[2])


    mq.delete((err, data) => {
        if (err) {
            console.error(err)
        } else {
            console.log(data)
        }
        process.exit()
    })
} else {
    console.log('usage: node deleteQ qname')
}